import { signupGoogleApi } from "../../Api/userApi"
export const updateUser = (
    {
        _id = '',
        email = '',
        password = '',
        givenName =  '',
        familyName = '',
        googleImageUrl='',        
    }={}
)=>({
    type:'UPDATE_USER',
    user:{
        _id,
        email,
        password,
        givenName,
        familyName,
        googleImageUrl,
    }
})

export const startCreateUser = (profile,token) =>{    
    return (dispatch) =>{        
        signupGoogleApi(profile,token).then(
            user =>{                
                dispatch(createUser(user));
            }
        ).catch(
            err =>{
                console.log(err);
            }
        )
    }
}
